import React from 'react';
import {  Routes, Route } from 'react-router-dom';
import Login from '../components/Login'
const LoginRoutes = () => {
 return (
   <Routes>
            <Route exact path="/login" 
              element={<Login/>}
            />
          </Routes>
 );
};

export default LoginRoutes;
